description:
Amy, a small-town girl meets and falls in love with Dan, a mysterious drifter.

Amy learns that Dan possesses a family curse and the unimaginable horror that was passed on to him by his father, Bender. Dan and Amy's love is put to the test when town locals unite in the ultimate showdown with Bender to eliminate the terror he has brought to their town...
